import React from "react";

const ListRender = () => {
  let list = ["Juan", "Lazaro", "Thiago", "Luan", "Pedro"];
  return (
    <section>
      <h2>Lista de presen√ßa</h2>
        <ul>
            {list.map((item) => item.toUpperCase(
                <li>{item}</li>
            ))}
        </ul>
    </section>
  );
};
export default ListRender;
